      Designation: "Employee",
      company : "Perfomatix"});
    }

    return (
      <>
      <button
          type="button"
          onClick={updateColor}
        >Blue</button>
        <h1>My Name is {user.name}</h1>
        <p>
          My Desigation is {user.Designation}.
        </p>
        <button
          type="button"
          onClick={updateColor}
        >Blue</button>
      </>
    )
}

